import React from "react";
import "./Login.css";
import {
  FormControl,
  TextField,
  Typography,
  Button,
} from "@mui/material";

const Login = () => {
  return (
    <div className="container">
      <div className=" form-box">
        <Typography variant="h3">Login</Typography>
        <FormControl  style = {{margin}}>
          <TextField label="Email" required variant="outlined" style={{marginBlock:"30px"}}/>
          <TextField label="Username" required variant="outlined" style = {{marginBlock: "30px"}}className="input" />
          <TextField
            label="Password"
            required
            variant="outlined"
            type="password"
            style = {{marginBlock:"30px"}}
          />
          <a href="#">Forgot Password ??</a>
          <Button variant="contained">Login</Button>
        </FormControl>
      </div>
    </div>
  );
};

export default Login;
